  true,\n\t\"url\": null,\n\t\"notes\": \"The Teacher Compensation Survey, 2009-10
  (TCS 2009-10), is part of the Common Core of Data (CCD) program. TCS 2009-10 (http://nces.ed.gov/ccd/tcssurvinfo.asp)
  is a cross-sectional universe survey that collected information on each public school
  teacher and on how public school teachers are compensated. TCS data are collected
  electronically from the administrative records of state education agencies. Participating
  state education agencies (SEAs) voluntarily submit TCS data. The studyufffds response
  rate has not been calculated as of March 2013. Key statistics produced from TCS
  2009-10 includes information on teachersufffd salaries, benefits, and compensations.\",\n\t\"license_title\":
